  static List<ShipmentOrder> listFromJson(dynamic json, {bool growable = false,}) {
    final result = <ShipmentOrder>[];
    if (json is List && json.isNotEmpty) {
      for (final row in json) {
        final value = ShipmentOrder.fromJson(row);
        if (value != null) {
          result.add(value);
        }
      }
    }
    return result.toList(growable: growable);
  }

  static Map<String, ShipmentOrder> mapFromJson(dynamic json) {
    final map = <String, ShipmentOrder>{};
    if (json is Map && json.isNotEmpty) {
      json = json.cast<String, dynamic>(); // ignore: parameter_assignments
      for (final entry in json.entries) {
        final value = ShipmentOrder.fromJson(entry.value);
        if (value != null) {
          map[entry.key] = value;
        }
      }
    }
    return map;
  }

  // maps a json object with a list of ShipmentOrder-objects as value to a dart map
  static Map<String, List<ShipmentOrder>> mapListFromJson(dynamic json, {bool growable = false,}) {
    final map = <String, List<ShipmentOrder>>{};
    if (json is Map && json.isNotEmpty) {
      // ignore: parameter_assignments
      json = json.cast<String, dynamic>();
      for (final entry in json.entries) {
        map[entry.key] = ShipmentOrder.listFromJson(entry.value, growable: growable,);
      }
    }
    return map;
  }

